import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after typing
    const step2 = path.join(screenshotsDir, 'step_2_typed_iphone.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using XPath for the first visible .search-btn after the input
    const searchBtnXPath = '//input[@placeholder="Search Amazon"]/following-sibling::button[contains(@class,"search-btn")]';
    await page.waitForSelector(searchBtnXPath, { timeout: 5000 });

    // Click the search button
    await page.click(searchBtnXPath);

    // Wait for a heading or text indicating search results (using text selector)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of the results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the titles of all visible products in the results (using .product-title class)
    const productTitles = await page.$$eval('.product-title', nodes => nodes.map(n => n.textContent.trim()).filter(Boolean));

    // Find if any product contains 'iPhone' in the title
    const iphoneProducts = productTitles.filter(title => title.toLowerCase().includes('iphone'));

    return {
      success: true,
      action: "Searched for 'iPhone' and extracted product titles from search results",
      extractedData: {
        totalResults: productTitles.length,
        iphoneProducts
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
